import React from 'react';
import PropTypes from 'prop-types';

//app
import styles from './DmsDocDetailsTooltip.styles';
import * as utils from 'utils';
import config from 'config';

//mui
import { makeStyles, Grid, Box } from '@material-ui/core';

DmsDocDetailsTooltip.propTypes = {
  data: PropTypes.arrayOf(PropTypes.object).isRequired
}

export default function DmsDocDetailsTooltip({ data }) {

  const classes = makeStyles(styles, { name: 'DmsDocDetailsTooltip' })();

  const toolTipData = [
    { label: utils.string.t('dms.metadata.documentDetails.documentName'), labelInfo: data?.documentName },
    { label: utils.string.t('dms.metadata.documentVersion.documentVersion'), labelInfo: data?.documentVersion },
    { label: utils.string.t('reportingExtended.reporting.columns.createdBy'), labelInfo: data?.createdByName },
    { label: utils.string.t('reportingExtended.reporting.columns.createdDate'), labelInfo: utils.string.t('format.date', { value: { date: data?.createdDate, format: config.ui.format.date.text } }) },
    { label: utils.string.t('dms.toolTip.updatedDate'), labelInfo: utils.string.t('format.date', { value: { date: data?.updatedDate, format: config.ui.format.date.text } }) },
    { label: utils.string.t('reportingReport.lastUpdated'), labelInfo: utils.string.t('format.date', { value: { date: data?.updatedDate, format: config.ui.format.date.text } }) },
    { label: utils.string.t('dms.view.columns.documentType'), labelInfo: data?.documentTypeDescription },
    { label: utils.string.t('dms.toolTip.referenceID'), labelInfo: data?.referenceId },
    { label: utils.string.t('dms.toolTip.catCodesID'), labelInfo: data?.catCodesID },
    { label: utils.string.t('dms.toolTip.departmentID'), labelInfo: data?.departmentId },
    { label: utils.string.t('dms.upload.commonInfoSection.sectionType'), labelInfo: data?.sectionType },
    { label: utils.string.t('dms.toolTip.sentToGXB'), labelInfo: !!data?.isUploadedOnGxb ? utils.string.t('app.yes') : utils.string.t('app.no') },
    { label: utils.string.t('dms.toolTip.docSource'), labelInfo: data?.srcApplication }
  ]

  return (
    <Box sx={{ width: '100%' }} mt={2} mb={2}>
      <Grid container rowSpacing={1} columnSpacing={{ xs: 1, sm: 2, md: 3 }}>
        {toolTipData.map((data) => {
          return (
            <Grid item xs={6}>
              <span className={classes.label}>
                {`${data.label}: ${data.labelInfo}`}
              </span>
            </Grid>
          )
        })}
      </Grid>
    </Box>
  )
}
